My best nights home have been spent @mtwbooks. 
@mtwbooks empowers young people who have been involved in the justice or child welfare systems by putting them in charge of this brick and mortar and online bookstore. Please check them out and support them. 
Oh...and these young people should be on the boards of your #companies, #schools, #non-profits, and city leadership. Ask them questions and you will be amazed by their insight.
